  false,\n\t\"url\": null,\n\t\"notes\": \"This paper discusses the status and possible
  future of wolf management in interior and arctic Alaska. The paper begins by discussing
  the history of the human-wolf relationship, and moves on to current control techniques.
  An analysis of the preliminary results related to age composition of populations,
  age of sexual maturity, number of young produced, the survival of these young, and
  factors that tend to inflict mortality to wolf populations other than human causes
  in included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
